public BuildingData(String type, Timestamp week, int height, int neighborhoodX, int neighborhoodY, int cityBlock, String url, int projectid, int buildingID, String lastEditorString, Timestamp created, Timestamp lastModified) {
    this.type = type;
    this.week = week;
    this.height = height;
    this.neighborhoodX = neighborhoodX;
    this.neighborhoodY = neighborhoodY;
    this.cityBlock = cityBlock;
    this.url = url;
    this.projectid = projectid;
    this.buildingID = buildingID;
    this.lastEditorString = lastEditorString;
    this.created = created;
    this.lastModified = lastModified;
}
